(18, 147, 1, 47, 56, 1, 'auction', 'com_content', 'Auction', 'auction', '', '<p>Edmund Tie &amp; Company&rsquo;s auctions have become a widely recognised method of sale in the Singapore property market, an event that is attended by both prospective sellers and buyers each month.</p>\r\n<p>Our auctioneers have experience in landed and non-landed housing, HDB units, shophouses and industrial and commercial properties. Auctions are usually conducted once a month.</p>\r\n<p><strong>Venue</strong>: Amara Singapore Hotel, 165 Tanjong Pagar Road, Level 3 Connection Room<br /> <strong>Time :</strong> From 2.30pm onwards</p>', 1, 0, '0000-00-00 00:00:00', 1, '{\"category_layout\":\"\",\"image\":\"images\\/articles\\/services\\/sv5.jpg\",\"image_alt\":\"\"}', '', '', '{\"author\":\"\",\"robots\":\"\"}', 982, '2017-08-14 01:35:40', 982, '2017-08-28 07:04:21', 0, '*', 1),
