(2, 87, 'About Edmund Tie & Company', 'about-edmund-tie-company', '<div class=\"about\">\r\n    <div class=\"container\">\r\n        <div class=\"section first\">\r\n            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad min im veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur lamco. Puis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. </p>\r\n        </div>\r\n    </div>\r\n\r\n    <figure>\r\n        <img src=\"images/articles/about-1.jpg\">    \r\n    </figure>\r\n    <div class=\"container\">\r\n        <div class=\"section\">\r\n            <h4 class=\"text-center\">Local expertise, international standards</h4>\r\n            <div class=\"row\">\r\n                <div class=\"col-md-6 col-sm-6\">\r\n                    <p>Founded in 1995, Edmund Tie & Company held the distinction as one of the first locally owned firms to compete on par with the international property consulting companies. </p>\r\n                    <p>Helmed by a leadership team comprising some of the most credentialed names in real estate, together with new talents that have come on board, we are now a 500-strong regional organisation with operations covering Singapore, Malaysia, Thailand and Indochina.</p>\r\n                </div>\r\n                <div class=\"col-md-6 col-sm-6\">\r\n                    <p>Through our China Desk, we provide real estate expertise for the vast Chinese market, offering advisory and agency services for Chinese capital seeking to invest in Southeast Asia.</p>\r\n                    <p>A uniquely Asian company like ours – having an intimate appreciation of cultural norms, local customs, business practices and government regulations, while at the same time delivering standards that are international – is thus well-positioned to deliver transformative solutions that will help all our clients flourish in property markets in the region.</p>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>', '', 1, 2, '2017-07-25 10:02:25', 982, '', '2017-07-26 04:16:02', 982, 0, '0000-00-00 00:00:00', '2017-07-25 10:02:25', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"edmundtie:single\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 9, 7, '', '', 1, 92, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
