(4, 95, 'Mr Tie Nyuk Siong, Edmund', 'mr-tie-nyuk-siong-edmund', '<h5>Executive Chairman</h5>\r\n\r\n<p>Mr Edmund Tie has over 40 years&rsquo; experience in real estate consultancy with expertise covering the full range of agency-related services and operations. In particular, he specialises in general agency, development and marketing consultancy and investment sales. Edmund has a strong regional perspective and understanding of the real estate industry with a wide contact base of property owners and developers.</p>\r\n', '', 1, 9, '2017-07-26 06:33:42', 982, '', '2017-07-26 09:48:03', 982, 0, '0000-00-00 00:00:00', '2017-07-26 06:33:42', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articles\\/management-team\\/tie-nyuk-siong.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 9, 5, '', '', 1, 7, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(5, 96, 'Ms Ong Choon Fah', 'ms-ong-choon-fah', '<h5>Chief Executive Officer</h5>\r\n\r\n<p>Ms Ong Choon Fah has over 25 years of experience in the real estate industry and academia. Her expertise is focused on strategic planning, real estate market and financial feasibility analyses, consumer surveys, risk assessments and market appraisals. Choon Fah has worked across various sectors of the real estate market in different geographies, with public and private sector clients, for-profit and not-for-profit organisations, occupiers, investors, institutions and REITs.</p>\r\n', '', 1, 9, '2017-07-26 06:35:59', 982, '', '2017-07-26 09:47:44', 982, 0, '0000-00-00 00:00:00', '2017-07-26 06:35:59', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articles\\/management-team\\/ong-choon-fah.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 6, 4, '', '', 1, 1, '{\"robots\":\"\",\"author\":\"\",\"rights\