(6, 97, 'Mr Ng San Tiong, Roland', 'mr-ng-san-tiong-roland', '<h5>Non-executive Director</h5>\r\n\r\n<p>Currently the president of the Singapore Chinese Chamber of Commerce and Industry (SCCCI), Mr Roland Ng is the managing director and group chief executive of crane supplier Tat Hong Holdings. Roland is also a member of the Board of Directors of Business China, the Board of Trustees of the Chinese Development and Assistance Council (CDAC), and also sits on the board of several SGX-listed companies.</p>\r\n', '', 1, 9, '2017-07-26 06:38:11', 982, '', '2017-07-26 09:47:27', 982, 0, '0000-00-00 00:00:00', '2017-07-26 06:38:11', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articles\\/management-team\\/ng-san-tiong.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 6, 3, '', '', 1, 1, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(7, 98, 'Mr Ng Cheng Kang, Andrew', 'mr-ng-cheng-kang-andrew', '<h5>Non-executive Director</h5>\r\n\r\n<p>With a background in investment banking for the energy, oil & gas and LNG sectors, Mr Andrew Ng’s expertise covers deal sourcing, business development, investment analysis and portfolio monitoring. Andrew is also an Executive Director of Triplestar Holdings, an investment firm which sources for opportunities through equity investments, merger and acquisitions and strategic partnerships.</p>\r\n', '', 1, 9, '2017-07-26 06:39:48', 982, '', '2017-07-26 09:46:51', 982, 0, '0000-00-00 00:00:00', '2017-07-26 06:39:48', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/no-avatar.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(8, 99, 'Mr Ng Cheng Xun, Christopher', 'mr-ng-cheng-xun-christopher', '<h5>Non-executive Director</h5>\r\n\r\n<p>An investment banker by training, Mr Christopher Ng was an associate at Rippledot Capital Advisers, where he was involved in several buy and sell-side advisory for a number of corporates and private equity firms in various sectors. Prior to joining Rippledot, Christopher was a Corporate Finance Associate in CIMB Bank Berhad. He is also an Executive Director of Triplestar Holdings and primarily handles the company’s real estate projects and businesses.</p>\r\n', '', 1, 9, '2017-07-26 06:42:20', 982, '', '2017-07-26 09:47:10', 982, 0, '0000-00-00 00:00:00', '2017-07-26 06:42:20', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/no-avatar.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 6, 2, '', '', 1, 2, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '