(87, 251, 'Commercial & Retail', 'commercial-retail', '<div class=\"service-detail\">\r\n    <div class=\"section \">\r\n        <p>Leveraging on our longstanding experience and extensive network, Edmund Tie & Company’s commercial division has the versatility to advise landlords and occupiers across both the office and industrial sectors.</p>\r\n        <p>As one of the prominent market players that is transacting over a million square feet of business space a year in Southeast Asia, our wide-ranging expertise includes development and marketing consultancy, agency, tenant representation, lease negotiations, strategic advice and feasibility studies to add value, drive performance and achieve cost-efficiencies for our clients. The commercial function also includes a retail team which enjoys an unrivalled reputation across major brands in various Southeast Asian markets.</p>\r\n        <ul class=\"black-dot\">\r\n            <li class=\"desc\">Why choose us?</li>\r\n            <li>Over 25 million sq ft of commercial space sold and leased</li>\r\n            <li>Extensive project marketing experience in more than 30 projects with both private and public sectors such as Ocean Financial Centre, One Raffles Place, \r\n   HarbourFront Towers, Suntec City Tower, 18 Cross Street, JTC Summit, HDB Hub, Golden Agri Plaza and Solaris etc.</li>\r\n            <li>Represented global occupiers in leasing prime office space: Facebook (South Beach), Lloyd’s (CapitaGreen), Vodafone (Asia Square), AllianceBernstein \r\n   (One Raffles Quay), Rabobank (South Beach) etc.</li>\r\n            <li>Secured business park and industrial space for multinational clients such as Apple, Continental, ICON, Modec, Polycom, Roche, Waters Technologies etc.</li>\r\n        </ul>\r\n    </div>\r\n</div>', '', 1, 2, '2017-08-29 10:04:51', 982, '', '2017-08-29 10:15:01', 982, 0, '0000-00-00 00:00:00', '2017-08-29 10:04:51', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"edmundtie:single\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 2, 1, '', '', 1, 3, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(88, 252, 'Residential Agency', 'residential-agency', '<div class=\"service-detail\">\r\n    <div class=\"section \">\r\n        <p>The residential team comprises a specialised project-marketing team that offers development consultancy and marketing services for developers of residential and mixed use projects.</p>\r\n        <p>Our clients include major developers, individual and corporate investors, landlords, tenants, real estate funds. Backed by a thorough understanding of the local and regional markets, we have transacted some SGD 120bn dollars worth of residential properties, including the sale of 20,000 new homes worth almost SGD 24bn.</p>\r\n        <ul class=\"black-dot\">\r\n            <li class=\"desc\">Why choose us?</li>\r\n            <li>A full understanding of local market conditions and other factors that govern home buying and investments</li>\r\n            <li> Supported by some 1,400 associates from Edmund Tie & Company Property Network, one of the largest real estate agencies in Singapore, which ensures \r\n   depth of coverage and market penetration</li>\r\n            <li>Strong track record and experience in marketing prestigious projects which includes Luxus Hills, One Balmoral, South Beach Residences and Wallich \r\n   Residences</li>\r\n        </ul>\r\n    </div>\r\n</div>', '', 1, 2, '2017-08-29 10:19:03', 982, '', '2017-08-29 10:19:03', 0, 0, '0000-00-00 00:00:00', '2017-08-29 10:19:03', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"edmundtie:single\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '');

