(100, 85, 'Mod Research - guest - Homepage', '', '<div class=\"mod-research lightgray\">\r\n    <div class=\"container\">\r\n        <div class=\"col-title\">\r\n            <h3 class=\"mod-title\">Research</h3>\r\n            <a class=\"view-all\" href=\"index.php?option=com_content&view=category&id=20&Itemid=252\">View All Articles</a>\r\n        </div>\r\n        <div class=\"col-info\">\r\n            <div class=\"row\">\r\n                <div class=\"col-md-4 col-sm-4\">\r\n                    <div class=\"rsch-item\">\r\n                        <div class=\"rsch-image\" data-mh=\"img-group\">\r\n                            <img src=\"images/modules/research1.jpg\">\r\n                            <a class=\"link-cover\" href=\"#\">#</a>\r\n                        </div>\r\n                        <div class=\"info\" data-mh=\"info-group\">\r\n                            <h4><a href=\"#\"> Government Land Sales H1 2017</a></h4>\r\n                            <div class=\"text\">We have identified three prominent sites for the GLS programme in H1 2017.</div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-md-4 col-sm-4\">\r\n                    <div class=\"rsch-item\">\r\n                        <div class=\"rsch-image\" data-mh=\"img-group\">\r\n                            <img src=\"images/modules/research2.jpg\">\r\n                            <a class=\"link-cover\" href=\"#\">#</a>\r\n                        </div>\r\n                        <div class=\"info\" data-mh=\"info-group\">\r\n                            <h4><a href=\"#\">Real Estate Times Malaysia Q4 2016</a></h4>\r\n                            <div class=\"text\">Are Malaysian real estate markets bottoming out in 2017?</div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-md-4 col-sm-4\">\r\n                    <div class=\"rsch-item\">\r\n