(51, 5, 1, '', '2017-07-26 09:47:44', 982, 2366, '24d303ac5bc8cd005cdaf209a77091433fc74717', '{\"id\":5,\"asset_id\":\"96\",\"title\":\"Ms Ong Choon Fah\",\"alias\":\"ms-ong-choon-fah\",\"introtext\":\"<h5>Chief Executive Officer<\\/h5>\\r\\n\\r\\n<p>Ms Ong Choon Fah has over 25 years of experience in the real estate industry and academia. Her expertise is focused on strategic planning, real estate market and financial feasibility analyses, consumer surveys, risk assessments and market appraisals. Choon Fah has worked across various sectors of the real estate market in different geographies, with public and private sector clients, for-profit and not-for-profit organisations, occupiers, investors, institutions and REITs.<\\/p>\\r\\n\",\"fulltext\":\"\",\"state\":1,\"catid\":\"9\",\"created\":\"2017-07-26 06:35:59\",\"created_by\":\"982\",\"created_by_alias\":\"\",\"modified\":\"2017-07-26 09:47:44\",\"modified_by\":\"982\",\"checked_out\":\"982\",\"checked_out_time\":\"2017-07-26 09:47:33\",\"publish_up\":\"2017-07-26 06:35:59\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/articles\\\\\\/management-team\\\\\\/ong-choon-fah.jpg\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\